import React from 'react';
import { X, Copy, Download } from 'lucide-react';

const TaskModal = ({ task, isOpen, onClose }) => {
  if (!isOpen || !task) return null;

  const copyToClipboard = (text) => {
    navigator.clipboard.writeText(text);
  };

  const downloadResult = () => {
    if (!task.result) return;

    const blob = new Blob([task.result], { type: 'text/plain' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = `task-${task.task_id.slice(0, 8)}-result.txt`;
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
    URL.revokeObjectURL(url);
  };

  return (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center p-4 z-50">
      <div className="bg-white rounded-lg max-w-4xl w-full max-h-[90vh] overflow-hidden">
        <div className="flex items-center justify-between p-6 border-b border-gray-200">
          <h2 className="text-xl font-semibold text-gray-900">Task Details</h2>
          <button
            onClick={onClose}
            className="p-2 text-gray-400 hover:text-gray-600 transition-colors"
          >
            <X className="w-5 h-5" />
          </button>
        </div>

        <div className="p-6 overflow-y-auto max-h-[calc(90vh-120px)]">
          <div className="space-y-6">
            <div>
              <h3 className="text-sm font-medium text-gray-700 mb-2">Task ID</h3>
              <div className="flex items-center space-x-2">
                <code className="bg-gray-100 px-2 py-1 rounded text-sm font-mono">
                  {task.task_id}
                </code>
                <button
                  onClick={() => copyToClipboard(task.task_id)}
                  className="p-1 text-gray-400 hover:text-gray-600 transition-colors"
                  title="Copy task ID"
                >
                  <Copy className="w-4 h-4" />
                </button>
              </div>
            </div>

            <div>
              <h3 className="text-sm font-medium text-gray-700 mb-2">Status</h3>
              <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${
                task.status === 'completed' ? 'bg-success-100 text-success-800' :
                task.status === 'running' ? 'bg-warning-100 text-warning-800' :
                task.status === 'failed' ? 'bg-error-100 text-error-800' :
                'bg-gray-100 text-gray-800'
              }`}>
                {task.status.charAt(0).toUpperCase() + task.status.slice(1)}
              </span>
            </div>

            <div>
              <h3 className="text-sm font-medium text-gray-700 mb-2">Created At</h3>
              <p className="text-sm text-gray-600">
                {new Date(task.created_at).toLocaleString()}
              </p>
            </div>

            {task.completed_at && (
              <div>
                <h3 className="text-sm font-medium text-gray-700 mb-2">Completed At</h3>
                <p className="text-sm text-gray-600">
                  {new Date(task.completed_at).toLocaleString()}
                </p>
              </div>
            )}

            {task.result && (
              <div>
                <div className="flex items-center justify-between mb-2">
                  <h3 className="text-sm font-medium text-gray-700">
                    {task.status === 'failed' ? 'Error Details' : 'Result'}
                  </h3>
                  <div className="flex space-x-2">
                    <button
                      onClick={() => copyToClipboard(task.result)}
                      className="inline-flex items-center px-2 py-1 text-xs text-gray-600 hover:text-gray-800 transition-colors"
                      title="Copy result"
                    >
                      <Copy className="w-3 h-3 mr-1" />
                      Copy
                    </button>
                    {task.status === 'completed' && (
                      <button
                        onClick={downloadResult}
                        className="inline-flex items-center px-2 py-1 text-xs text-gray-600 hover:text-gray-800 transition-colors"
                        title="Download result"
                      >
                        <Download className="w-3 h-3 mr-1" />
                        Download
                      </button>
                    )}
                  </div>
                </div>
                <div className={`p-4 rounded-lg border ${
                  task.status === 'failed' 
                    ? 'bg-error-50 border-error-200' 
                    : 'bg-gray-50 border-gray-200'
                }`}>
                  <pre className="text-sm whitespace-pre-wrap break-words">
                    {task.result}
                  </pre>
                </div>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default TaskModal;
